import styled from "styled-components";

export const Wrapper = styled.div`
width: 100vw;
height: 30vh;

background : rgb(252,245,245);
display: flex;
font-family: Menlo,monospace;
color : #8d8741;
`;

export const Content = styled.div`

`;
